import React, { Component, useState } from "react";

export default function Home() {
  return (
    <div className="row">
      <div className="col col-12">
        <h1>Home</h1>
        <div class="card">
          <div class="card-body">
            <div
              id="container-speed"
              style="width: 450px; height: 300px; float: left"
            ></div>
          </div>
        </div>
      </div>
    </div>
  );
}
